import x from './data/python_res.js'
import "../style.css"
function CourseItem(props) {
    return(
        <div class = "one-course">
          <img class = "ph" src={props.data.courses[props.ID].image}/>
          <p class = "tit">{x.courses[props.ID].title}</p>
          <p class = "cent">{x.courses[props.ID].instructors[0].name}</p>
          <span class="checked cent">&#9733;&#9733;&#9733;&#9733;</span>
          <span>&#9733; </span>
          <span >({x.courses[props.ID].rating})</span>
          <p class = "cent">${x.courses[props.ID].price}</p>
      </div>
    );
  }
  
  export default CourseItem;
